$(document).ready(function(){$(".content img, #featured img").addClass("img-responsive");$(".content iframe, #featured iframe").addClass("embed-responsive-item iframe");$(window).on("load resize",function(){var k=$(window).height();var p=$(".navbar-static-top:first").height();var i=$(".bannerwrapper:first").height();var o=$(".searchlocations:first").height();var l=$(".searchpac:first").height();var j=$(".databases:first").height();var n=$(".footer:first").height();var m=k-p-i-o-l-j-n-300;if(m>0){$(".content:first").css({"min-height":m})}});$(window).scroll(function(){if($(this).scrollTop()>100){$(".scrollToTop").fadeIn()}else{$(".scrollToTop").fadeOut()}});$(".scrollToTop").click(function(){$("html, body").animate({scrollTop:0},500);return false});$('.carousel[data-type="multi"] .item').each(function(){var c=$(this).next();if(!c.length){c=$(this).siblings(":first")}c.children(":first-child").clone().appendTo($(this));for(var d=0;d<4;d++){c=c.next();if(!c.length){c=$(this).siblings(":first")}c.children(":first-child").clone().appendTo($(this))}})});function toggleSrc(c,d){$("iframe.hottitles-iframe").attr("src",c,d);$(".hotContainer").addClass("loader");$(".iframe").addClass("hidden")}window.onload=function(){var b=window.performance.timing.domContentLoadedEventEnd-window.performance.timing.navigationStart;console.log("Page load time is "+b);console.log(window.performance)};